import React from 'react'
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';

function Filter({selectedLocation}) {

  function handleLocationChange(event) {
    onLocationChange(event.target.value)
}

  return (
    <div>
    <h2>Filter by </h2>
      <FormControl fullidth>
          <InputLabel id="select-label">Location</InputLabel>
              <Select
                  labelId="select-label"
                  id="select"
                  onChange={handleLocationChange}
                  value={selectedLocation}
              >
                  <MenuItem value="All">All</MenuItem>
                  <MenuItem value="AR">Bags</MenuItem>
                  <MenuItem value="MS">Shoes</MenuItem>
                  <MenuItem value="ID">Pants</MenuItem>
                  <MenuItem value="OK">Tops</MenuItem>
              </Select>
      </FormControl>
    </div>
  )
}

export default Filter
